description:
[PublicAgent] Emily (1127 / 10.01.2013)

I love this girl. She made it all so easy for me. I still can't believe that she thought I was a real ticket inspector. I knew she did not buy a ticket as I saw her walk straight onto the tram. So I approached her and told her I was a ticket inspector and demanded to see her ticket. When I told her it was a 50 000 Crown fine for not having a ticket, she would do anything (with a little persuasion) to not pay that fine!.

